class NewsAppRepo {
  Future<NewsApp?> getNewsApp() async {
    try {
      var response = await http.get(Uri.parse(
          'https://newsapi.org/v2/everything?q=tesla&from=2023-06-23&sortBy=publishedAt&apiKey=5974f1f8a59f4bde89d3bfdd542707f1'));

      Map<String, dynamic> deCodeResponse = jsonDecode(response.body);
      if (response.statusCode == 200) {
        NewsApp date = NewsApp
            .(
                deCodeResponse);
        return date;
        // Process the updated data here
      } else {
        print('Field');
        return null;
        // Handle the error here
      }
      // your code that may throw an exception or error
    } catch (erorr) {
      // handle the exception or error here
      print('Exception caught: $erorr');
    }
  }
}
